print("\u6c17\u5019\u5909\u52d5\u3068\u6226\u3046\u305f\u3081\u306b\u79c1\u305f\u3061\u304c\u884c\u3063\u3066\u3044\u308b\u6700\u3082\u826f\u3044\u3053\u3068\u306e\u4e00\u3064\u306f\u3001\u518d\u751f\u53ef\u80fd\u30a8\u30cd\u30eb\u30ae\u30fc\u3092\u3088\u308a\u591a\u304f\u5229\u7528\u3059\u308b\u3053\u3068\u3067\u3059\u3002\u592a\u967d\u5149\u767a\u96fb\u3001\u98a8\u529b\u767a\u96fb\u3001\u6c34\u529b\u767a\u96fb\u306f\u3001\u307e\u3059\u307e\u3059\u826f\u304f\u306a\u308a\u3001\u5b89\u304f\u306a\u3063\u3066\u3044\u307e\u3059\u3002\u30c9\u30a4\u30c4\u3084\u30c7\u30f3\u30de\u30fc\u30af\u306a\u3069\u306e\u56fd\u3005\u306f\u3001\u4e3b\u306b\u518d\u751f\u53ef\u80fd\u30a8\u30cd\u30eb\u30ae\u30fc\u3092\u5229\u7528\u3057\u3001\u5316\u77f3\u71c3\u6599\u3092\u6392\u9664\u3059\u308b\u3053\u3068\u3067\u5148\u982d\u3092\u8d70\u3063\u3066\u3044\u307e\u3059\u3002\u307e\u305f\u3001\u79c1\u305f\u3061\u306f\u96fb\u6c17\u81ea\u52d5\u8eca\u3092\u3082\u3063\u3068\u5229\u7528\u3057\u3088\u3046\u3068\u3057\u3066\u3044\u307e\u3059\u3002\u306a\u305c\u306a\u3089\u3001\u305d\u308c\u3089\u306f\u3042\u307e\u308a\u6c5a\u67d3\u3092\u8d77\u3053\u3055\u306a\u3044\u304b\u3089\u3067\u3059\u3002\u5927\u624b\u81ea\u52d5\u8eca\u30e1\u30fc\u30ab\u30fc\u306f\u3001\u96fb\u6c17\u81ea\u52d5\u8eca\u3092\u5897\u7523\u3057\u3066\u304a\u308a\u3001\u653f\u5e9c\u306f\u4eba\u3005\u304c\u305d\u308c\u3089\u3092\u8cfc\u5165\u3059\u308b\u305f\u3081\u306b\u304a\u91d1\u3092\u63d0\u4f9b\u3057\u3066\u3044\u307e\u3059\u3002\u3053\u308c\u306b\u3088\u308a\u3001\u79c1\u305f\u3061\u306f\u8eca\u304b\u3089\u306e\u6c5a\u67d3\u3092\u5927\u5e45\u306b\u6e1b\u3089\u3059\u3053\u3068\u304c\u3067\u304d\u307e\u3059\u3002\u30af\u30ea\u30fc\u30f3\u30a8\u30cd\u30eb\u30ae\u30fc\u3068\u96fb\u6c17\u81ea\u52d5\u8eca\u306e\u5229\u7528\u306f\u3001\u6c17\u5019\u5909\u52d5\u3092\u6b62\u3081\u308b\u4e0a\u3067\u5927\u304d\u306a\u9055\u3044\u3092\u751f\u307f\u51fa\u3057\u307e\u3059\u3002")